import styled from "styled-components";
import "./App.css";
import { Button, Container } from "react-bootstrap";
import { BrowserRouter, Link } from "react-router-dom";
import Ticket from "./Tickets";
import { fetchTasks } from "./Service";
import { useState, useEffect } from "react";
import axios from "axios";

const cors = require("cors");
let app = express();
app.use(cors());

app.get("/v1/api/tasks", function (req, res, next) {
  res.json({ msg: "This is CORS-enabled for all origins!" });
});

const Title = styled.div`
  padding-top: 20px;
  padding-bottom: 20px;
  text-align: center;
  font-size: 40px;
  color: white;
  font-family: "Noto Serif", serif;
`;

const Completed = styled.div`
  display: grid;
  text-align: center;
  text-decoration: none;
  color: white;
  padding-bottom: 30px;
`;

const Home = () => {
  const axios = require("axios");
  const [task, setTask] = useState([]);
  const [error, setError] = useState(null);

  const fetchTasks = async () => {
    const url = "localhost:8080/v1/api/tasks";
    try {
      const response = await axios.get(url);
      const data = response.data;
      return data;
      console.log(data);
    } catch (error) {
      console.warn("Failed to load tasks");
      throw Error("Nem sikerült betölteni a feladatok listáját!");
    }
  };

  const valami = () => {
    axios("localhost:8080/v1/api/tasks", {
      method: "HEAD",
      mode: "no-cors"
    })
      .then((response) => {
        console.log(response);
      })
      .catch((e) => {
        console.log(e);
      });
  };

  async function getUser() {
    try {
      const response = await axios.get("http://localhost:8080/v1/api/tasks");
      console.log(response);
    } catch (error) {
      console.error(error);
    }
  }

  useEffect(() => {
    fetchTasks();
  }, []);

  return (
    <BrowserRouter>
      <div className="Home">
        <Title>Feladatok</Title>

        <Completed>
          <nav>
            <Link to="/uncompleted">
              <Button className="Uncompleted" variant="dark">
                Elvégzendő feladatok
              </Button>
            </Link>
          </nav>

          <Link to="/completed">
            <Button className="Completed" variant="dark">
              Teljesített feladatok
            </Button>
          </Link>

          <Link to="all">
            <Button className="All" variant="dark">
              Összes feladat
            </Button>
          </Link>

          <Link to="new">
            <Button className="Add" variant="dark">
              Feladat hozzáadása
            </Button>
          </Link>
        </Completed>
        <Ticket />
      </div>
    </BrowserRouter>
  );
};

export default Home;
